  authDomain: "react-olx-junaid.firebaseapp.com",
  projectId: "react-olx-junaid",
  storageBucket: "react-olx-junaid.appspot.com",
  messagingSenderId: "162169506747",
  appId: "1:162169506747:web:c7899f0c15f5556ec0529e",
  measurementId: "G-3F77JX6Y7S"
};

// Initialize Firebase
